class Solution {
    func minimumAddedCoins(_ coins: [Int], _ target: Int) -> Int {
        var sortedCoins = coins.sorted()
        var currentSum = 0
        var addedCoins = 0

        for coin in sortedCoins where currentSum < target {
            while coin > currentSum + 1 && currentSum < target {
                currentSum += currentSum + 1
                addedCoins += 1
            }
            currentSum += coin
        }

        while currentSum < target {
            currentSum += currentSum + 1
            addedCoins += 1
        }

        return addedCoins
    }
}
